def is_palindrome(n):
    s = str(n)
    return s == s[::-1]

def is_palindrome_in_base(n, base):
    s = ''
    while n > 0:
        s += str(n % base)
        n //= base
    return s == s[::-1]

def count_palindromes_in_base(n, base):
    count = 0
    for i in range(n + 1):
        if is_palindrome_in_base(i, base):
            count += 1
    return count

def count_palindromes_in_bases(n, bases):
    count = 0
    for i in range(n + 1):
        if all(is_palindrome_in_base(i, base) for base in bases):
            count += 1
    return count

