    return s[::-1]

def check(s):
    for i in range(len(s)):
        if s[i] < s[i+1]:
            return True
    return False

def solve(s):
    n = len(s)
    for i in range(1, n-1):
        a = s[:i]
        b = s[i:]
        a = reverse(a)
        b = reverse(b)
        if check(a+b+s[i:]):
            return a+b+s[i:]
    return s

