class SegTree:
    def __init__(self, n, func, init):
        self.n = n
        self.func = func
        self.init = init
        self.log = (n - 1).bit_length()
        self.size = 1 << self.log
        self.tree = [self.init] * (2 * self.size)
    def set(self, i, x):
        i += self.size
        self.tree[i] = x
        while i > 1:
            i >>= 1
            self.tree[i] = self.func(self.tree[i << 1], self.tree[i << 1 | 1])
    def get(self, i):
        return self.tree[i + self.size]
    def prod(self, l, r):
        l += self.size
        r += self.size
        sml = self.init
        smr = self.init
        while l < r:
            if l & 1:
                sml = self.func(sml, self.tree[l])
                l += 1
            if r & 1:
                r -= 1
                smr = self.func(self.tree[r], smr)
            l >>= 1
            r >>= 1
        return self.func(sml, smr)
    def all_prod(self):
        return self.tree[1]
