                    l *= 2
                    if f(self.func(sm, self.tree[l])):
                        sm = self.func(sm, self.tree[l])
                        l += 1
                return l - self.size
            sm = self.func(sm, self.tree[l])
            l += 1
            if (l & -l) == l:
