    s = [0] * (n + 1)
    for i in range(n):
        s[a[i]] += 1
    for i in range(1, n):
        s[i] += s[i - 1]
    return s

def solve(a):
    n = len(a)
    s = inversions(a)
    ans = 0
    for i in range(n):
        if a[i] == -1:
            ans += s[i] * (n - i - 1) - s[i]
    return ans

