def is_prime(n):
    if n < 2:
        return False
    if n < 4:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def get_primes(n):
    primes = []
    for i in range(2, n + 1):
        if is_prime(i):
            primes.append(i)
    return primes

def get_frog_tower(primes, frogs):
    max_pos = 0
    max_size = 0
    for pos, d in frogs:
        size = 1
        while pos + d < len(primes):
            pos += d
            size += 1
        if size > max_size:
            max_pos = pos
            max_size = size
    return max_pos, max_size

